import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav } from 'react-bootstrap';
import './NavLink.css';
import { Link } from 'react-router-dom';

class NavLink extends React.Component {
  render() {
    return (
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="AllLinks">
          <Nav.Link
            data-testid="link-to-search"
            className="navLiks"
            eventKey={ 2 }
            href="/search"
          >
            Search
          </Nav.Link>
          <Nav.Link
            className="navLiks"
            data-testid="link-to-favorite"
            eventKey={ 2 }
            href="/favorites"
          >
            Favorites
          </Nav.Link>
          <Nav.Link>
            <Link className="navLiks" data-testid="link-to-profile" to="/profile">profile</Link>
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>

    );
  }
}
export default NavLink;
